            {    
                case "service6Eval.t_Ph3Result":
                    description = helptext = "Copy of OBDAdap.t_Ph3Result for ScanTool service 6 output. Copied when all dependencies are resolved.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.N_FlankShiftCnt":
                    description = helptext = "Copy of obdO2SResp.N_FlankShiftCnt for ScanTool service 6 output. Copied when all dependencies are resolved.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.N_AdjCombustCnt":
                    description = helptext = "Copy of obdO2SResp.N_AdjCombustCnt for ScanTool service 6 output. Copied when all dependencies are resolved.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.BigLeakageResult":
                    description = helptext = "Copy of OBDAdapEvap.LeakageResult for ScanTool service 6 output. Copied when all depends are resolved. For big leaks the values stored are from be 1011 to 1053 (copied from obdEvap.LeakageFactor). The value is lifted with 5 since the 15031-5 standard does not allow negative numbers.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.SmallLeakageResult":
                    description = helptext = "Copy of OBDAdapEvap.LeakageResult for ScanTool service 6 output. Copied when all depends are resolved. The value is lifted with 5 since the 15031-5 standard does not allow negative numbers.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.VerySmallLeakageResult":
                    description = helptext = "Copy of OBDAdapEvap.LeakageResult for ScanTool service 6 output. Copied when all depends are resolved. The value is lifted with 5 since the 15031-5 standard does not allow negative numbers.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.pRatioMean":
                    description = helptext = "Copy of obdSAI.pRatioMean for ScanTool service 6 output. Copied when all depends are resolved.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.U_O2SensPreMax":
                    description = helptext = "Maximum value of ActualIn.U_O2SensFront for ScanTool service 6 output. This value is updated for every DCY when all conditions for diagnosis is OK or when a fault has been set, i.e. the last known maximun sensor voltage for a DCY is stored.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.U_O2SensPreMin":
                    description = helptext = "Minimum value of ActualIn.U_O2SensFront for ScanTool service 6 output. This value is updated for every DCY when all conditions for diagnosis is OK or when a fault has been set, i.e. the last known minimun sensor voltage for a DCY is stored.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "service6Eval.U_O2SensPostMax":
                    description = helptext = "Maximum value of ActualIn.U_O2SensRear for ScanTool service 6 output. This value is updated for every DCY when all conditions for diagnosis is OK or when a fault has been set, i.e. the last known maximun sensor voltage for a DCY is stored.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
