                    description = helptext = "Action decided by the AC Controller. RESOLUTION : - RANGE:       AC_DELAY (0)             = delay any requested action AC_ENGAGE (1)            = engage the AC clutch AC_DISENGAGE (2)         = disengage the AC clutch AC_DISENGAGE_NOW (3)     = disengage the AC clutch right away AC_NO_ENGAGE_ALLOWED (4) = no engagement of AC clutch allowed AC_ENGAGE_ALLOWED (5)    = engagement of AC clutch allowed. AC_SC_ENGAGE_NOW (6)     = Scan Tool has requested and been granted to engage the AC clutch. AC_SC_DISENGAGE_NOW (7)  = Scan Tool has requested and been granted to disengage the AC clutch.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "AC_Control.ST_ActionReason":
                    description = helptext = "Reason why the AC Controller decided on an action. RESOLUTION : - RANGE:       AC_NO_ACTION_REASON (0)                      = AC Control has not restricted engagement/disengagement of the AC at all. AC_DISENGAGE_FAULTY_PRESSURE_SENSOR (1)      = AC disengaged because the pressure sensor is faulty. AC_DISENGAGE_HIGH_PRESSURE (2)               = AC disengaged due to high pressure. AC_DISENGAGE_LOW_PRESSURE (3)                = AC disengaged due to low pressure. AC_DISENGAGE_HIGH_ENGINE_SPEED (4)           = AC disengaged due to high engine speed. AC_DISENGAGE_LOW_ENGINE_SPEED (5)            = AC disengaged due to low engine speed. AC_DISENGAGE_HIGH_VOLTAGE (6)                = AC disengaged due to high voltage. AC_DISENGAGE_LOW_VOLTAGE (7)                 = AC disengaged due to low voltage. AC_DISENGAGE_FAULTY_TEMPERATURE_SENSOR (8)   = AC disengaged due to high engine coolant temperature. AC_DISENGAGE_HIGH_TEMPERATURE (9)            = AC disengaged due to high engine coolant temperature. AC_DISENGAGE_ENGINE_STALLING (10)            = AC disengaged due to a stalling engine. AC_DISENGAGE_IMPROVE_VEHICLE_PERFORMANCE (11)= AC disengaged to improve vehicle performance. AC_DISENGAGE_UNSTABLE_ENGINE_SPEED (12)      = AC disengaged because the engine speed is unstable. AC_DISENGAGE_THROTTLE_BEEING_CLOSED (13)     = AC disengaged because the throttle is beeing closed. AC_DISENGAGE_DURING_DOWNSHIFT (14)           = AC disengaged because a downshift is in progress. AC_DISENGAGE_POWERTRAIN-DIAGNOSTICS (15)     = AC disengaged due to powertrain diagnostics. AC_DISENGAGE_IMPROVE_VEHICLE_LAUNCH (16)     = AC disengaged to improve preformance during vehicle take-off. AC_NO_ENGAGE_HIGH_ENGINE_SPEED (17)          = AC should not be engaged due to high engine speed. AC_NO_ENGAGE_LOW_ENGINE_SPEED (18)           = AC should not be engaged due to low engine speed. AC_DELAY_NOT_DISENGAGED_ENOUGH_TIME (19)     = Engagement delayed because AC has not been disengaged enough time. AC_DELAY_DURING_UPSHIFT (20)                 = Engagement delayed during upshift. AC_DELAY_DURING_DOWNSHIFT (21)               = Engagement delayed during downshift. AC_ENGAGE_ON_SCAN_TOOL_REQUEST (22)          = A Scan Tool has requested and been granted an engagement. AC_DISENGAGE_ON_SCAN_TOOL_REQUEST (23)       = A Scan Tool has requested and been granted a disengagement.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "AC_Control.ST_Dev_Cntrl_AC":
