                case "ETCThrot.ST_OOR1_FltLo":
                    description = helptext = "Indicates that the main processor has detected (and latched) a TPS 1 out of range low fault based upon its (sensed) throttle position 1.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
