                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ETCThrot.ST_OOR2_FltLo":
                    description = helptext = "Indicates that the main processor has detected (and latched) a TPS 2 out of range low fault based upon its (sensed) throttle position 2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ETCThrot.ST_OOR2_FltHi":
                    description = helptext = "Indicates that the main processor has detected (and latched) a TPS 2 out of range high fault based upon its (sensed) throttle position 2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
