                case "ETCThrot.ST_OOR1_Or_V5B_Err":
                    description = helptext = "Either TPS 1 or V5B has OutofRange error";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
