                case "ETCThrot.ST_OOR2_Flt_Composit":
                    description = helptext = "This object equals (ST_OOR2_Flt_MainOrMCP OR VLTR_TPS_2_OutofRngFlt_MainMCP).It is used to simplify condition checking in other modules.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
