                case "obdEvap.t_Ramp1_Level3":
                    description = helptext = "Time for ramp1 to complete level3.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.t_ColdStart":
                    description = helptext = "Shows the time that a coldstart is active. There is a max time for a coldstart due to during a cold start the ramp0 is redused and if the car is running to long the fuel is warmed up in the tank and all the problem with that is taken care of in ramp0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.t_ColdStartExt":
                    description = helptext = "Shows the time that a extended coldstart is active.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.LeakageFactor":
                    description = helptext = "Shows what kind of leakage 0 = ignition off 10 = No leak, test 1 11 = 0,5 leak test 1 12 = 1,0 leak test 1 13 = Filtered test, too big diff 20 = No leak, test 2 21 = 0,5 leak test 2 22 = 1,0 leak test 2 23 = Filtered test, too big diff 1011 = big leak in ramp 1 level 1 test 1 1012 = big leak in ramp 1 level 2 test 1 1013 = big leak in ramp 1 level 3 test 1 1021 = big leak in ramp 1 level 1 test 2 1022 = big leak in ramp 1 level 2 test 2 1023 = big leak in ramp 1 level 3 test 2 1031 = big leak in ramp 1 level 1 test 3 1032 = big leak in ramp 1 level 2 test 3 1033 = big leak in ramp 1 level 3 test 3 1041 = big leak in ramp 1 level 1 test 1 Cold start 1042 = big leak in ramp 1 level 2 test 1 Cold start 1043 = big leak in ramp 1 level 3 test 1 Cold start 1051 = big leak in ramp 1 level 1 test 2 Cold start 1052 = big leak in ramp 1 level 2 test 2 Cold start 1053 = big leak in ramp 1 level 3 test 2 Cold start";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.BigLeakageFactor":
                    description = helptext = "Saves a big leak factor (obdEvap.LeakageFactor). If a 0,5 test has performed later, then a big leak fault shall report, use this factor.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.v_VehicleSpeedPrecondition":
                    description = helptext = "When precondition is fulfilled, a speed limit is saved used for condition during test";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.HCContPrecondition":
                    description = helptext = "When precondition is fulfilled, a Purge.HCCont limit is saved used for condition during test, compared with hi/lo and diff limit.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.PurgePrecondition":
                    description = helptext = "When precondition is fulfilled, a Purge.AdaptionEvap limit.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.LambdaPrecondition":
                    description = helptext = "When precondition is fulfilled, a mean value of lambda int limit is saved used for ramp1,";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.Ramp0":
                    description = helptext = "Shows the evaporation in ramp0. The CCV valve and purge valve is closed for a calib time. The derivate becomes the ramp 0 value in pa/s.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.TotTabRamp2":
                    description = helptext = "Average calculation of total ramp2. Including each evaluation in ramp2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.DiffR2Result":
                    description = helptext = "Diff between each evaluation in Ramp2EvalResult buffer.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_AirAmbientDelta":
                    description = helptext = "Delta pAirAmbient max and min from obdEvappAirAmbientStack is updated every 3 min.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_AirAmbStack":
                    description = helptext = "Is updated every 3 min with In.p_AirAmbient.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.m_DeltaMax":
                    description = helptext = "Maximum load diff from MAF Quick change.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.LambdaMaxNegDiff":
                    description = helptext = "The lowest mean value of lambda int is saved in this variable.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.HCContDiff":
                    description = helptext = "The biggest diff between obdEvap.HCContPrecondition and Purge.HCCont during test.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.v_DiffPosMax":
                    description = helptext = "The biggest positive delta of vehicle speed from obdEvap.v_VehicleSpeedPrecondition.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.v_DiffNegMax":
                    description = helptext = "The biggest negative diff of vehicle speed from obdEvap.v_VehicleSpeedPrecondition.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_FuelTankFilt":
                    description = helptext = "Tank pressure signal, low pass filtrated.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_PreviousPressure":
                    description = helptext = "Last read pressure in fuellevel ripple.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp0":
                    description = helptext = "Max positive pressure reading during ramp0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp0":
                    description = helptext = "Max negative pressure reading during ramp0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp1":
                    description = helptext = "Max positve pressure reading during ramp1.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp1":
                    description = helptext = "Max negative pressure reading during ramp1.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp2":
                    description = helptext = "Max positve pressure reading during ramp2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp2":
                    description = helptext = "Max negative pressure reading during ramp2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_SwitchPoint":
                    description = helptext = "The lowest pressure when ramp2 starts.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_OkStatus":
                    description = helptext = "Shows EvaporatorDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = EVAP_SYSTEM_LEAK_DETECTED_SMALL_LEAK has reported ok Bit 1 = EVAP_SYSTEM_LEAK_DETECTED_SMALL_LEAK_FUEL has reported ok Bit 2 = EVAP_SYSTEM_LEAK_DETECTED_GROSS_LEAK has reported ok Bit 3 = EVAP_SYSTEM_LEAK_DETECTED_GROSS_LEAK_FUEL has reported ok Bit 4 = EVAP_SYSTEM_LEAK_DETECTED_VERY_SMALL_LEAK has reported ok Bit 5 = EVAP_SYSTEM_LEAK_DETECTED_VERY_SMALL_LEAK_FUEL has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_FaultCode":
                    description = helptext = "Shows EvaporatorDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.LeakageResult":
                    description = helptext = "This variable contains the result from the matrix table";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_FilterIgnoredByColdStart":
                    description = helptext = "If obdEvap.ST_ColdStart was enabled during test and test shpuld have aborted due HC consentration or lambda during test, this variable will be set and it will stop the test to report small leak. The variable also keeps track of which test is ignored (Bit 1 = Test 1, Bit 2 = Test 2)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.DiagState":
                    description = helptext = "Shows the evap diagnose all different states : 0 = ignition off 1 = diagnose interrupted 2 = precondition OK 3 = test phase 0 condition during test OK 4 = test phase 0 OK 5 = test phase 1 condition during test OK 6 = test phase 2 OK 7 = test phase 2 condition during test OK 8 = diagnose done, either ok or fault RANGE      : 0 - 8";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ActiveTest":
                    description = helptext = "1 - 0,5 mm test with no vehicle speed 2 - 1mm -> test with vehicle speed 3 - big leak, filler cap RANGE      : 1 - 3";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.BreakPreCondition":
                    description = helptext = "1 = obdEvap.ST_NeedForSpeed = 1 2 = In.v_Vehicle < pEvapTestCal->v_loLim or In.v_Vehicle > pEvapTestCal->v_hiLim 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod.test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 7 = Unused 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 9 = In.T_Engine < PurgeCal.T_EngineLim if obdEvap.ST_ColdStart = 1, else FuelAdap.ST_PurgeAllow = 0 (PURGE_NOT_ALLOWED) 10 = obdEvap.ST_ColdStart = 0 and purgeFirstStartRampOK = 0 12 = Purge.p_DiffNormal > -150 13 = Purge.AdaptionEvap < pEvapTestCal->PurgeloLim 14 = obdpTankAdap.ST_FaultCode > 0 15 = In.v_Vehicle has not been more than 44 Km/h for more than EvapTestCal->t_breakWaitTime 16 = PowerTrainRelay diagnosis has reported fault 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = Fault.v_Vehicle > 0 21 = obdCCV.ST_FaultCode > 0 22 = OBDAdap.ST_PurgeFault > 0 23 = obdBrakeLight.ST_FaultCode > 0 24 = obdTEng.ST_FaultCode > 0 25 = obdTAir.ST_FaultCode > 0 27 = obdEvap.ST_FillerCapTestDone = 1 and obdEvap.ActiveTest = 3 28 = obdEvap.ST_ColdStartExt = 0 and obdEvap.ActiveTest is not 3 and DiagActive.ST_EvapProductionTest = 0 29 = Lambda.Status > 0, T9: WBLam.ST_Control or LamMast.ST_ActiveLambdaReq is not 4 30 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 31 = obdEvap.N_VapourTest1 >= EvapDiagCal.N_VapourLimTest1 and obdEvap.ActiveTest = 1 (No more Test1 attempts, due to too many Test1 have been aborted by evaporaion) 32 = obdEvap.N_VapourTest2 >= EvapDiagCal.N_VapourLimTest2 and obdEvap.ActiveTest = 2 (No more Test2 attempts, due to too many Test2 or Test3 have been aborted by evaporation.) 33 = ManifoldAbsolutePressureSensor diagniosis has reported fault 34 = obdCCV.ST_ActiveRationality = 1 (the purge valve may already be controlled) 35 = obdCore.ST_DiagPriority is not 0 (another diagnose has run priority) 36 = obdSAI.WSDiagState is not 0 (SAI workshop test is running) 37 = Purge.ST_O2SensDiagFreeze nonzero (O2S Response test is running) 38 = The engine is running on idle and obdevap.activetest is 2 or 3 39 = TAmbMod.T_AirAmbient < EvapDiagCal.T_LoLim or TAmbMod.T_AirAmbient > EvapDiagCal.T_AmbHiLim 40 = TAmbMod.T_AirAmbAtStart < EvapDiagCal.T_LoLim or obdCore.T_AirInletStart < EvapDiagCal.T_LoLim";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.EvapPreBreakTemp":
                    description = helptext = "See obdEvap.BreakPreCondition for explanaition about the values.This shows the same as obdEvap.BreakPreCondition except that the ambient break conditions is excluded.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.BreakCondDurTest":
                    description = helptext = "2 = In.v_Vehicle < (obdEvap.v_VehicleSpeedPrecondition - pEvapTestCal->v_Diff) or In.v_Vehicle > (obdEvap.v_VehicleSpeedPrecondition + pEvapTestCal->v_Diff) 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod. test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 12 = Purge.p_DiffNormal >= -150 and obdEvap.DiagState < 6 13 = Purge.HCCont > (obdEvap.HCContPrecondition + pEvapTestCal->HCContDiff) 14 = m_Delta > EvapDiagCal.m_Delta or m_Delta < (0 - EvapDiagCal.m_Delta) 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_MinTank 21 = obdEvap.ST_ValveLockedByDiagnose = 1 and Purge.Status is not 6 22 = Purge.DiagFlow > 0 and Out.PWM_PurgeValve <= 0 34 = obdEvap.Ramp0 < EvapDiagCal.ramp0LoLim 35 = The engine is running on idle and obdevap.activetest is 2 or 3 36 = Purgeflow is too low due to max fuelfactor 101 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 first time in ramp 1 102 = Fuellevelripple determined 103 = obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim 105 = obdEvap.DiffR2Result[i] >= EvapDiagCal.maxPosR2Diff (Fuellevelripple during ramp2 evaluation small pos direction) 106 = obdEvap.DiffR2Result[i] < EvapDiagCal.maxNegR2Diff (Fuellevelripple during ramp2 evaluation small neg direction) 108 = T8: If Lambda.LambdaInt diff of obdEvap.LambdaPrecondition T9: If (WBLam.FuelFac - 1.0) diff of obdEvap.LambdaPrecondition 150 -> 200 = Big leak errors detected, needed 2 for error report when ignition off 254 = OBDAdapEvap.Evap2BigResDiff > 0";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.n_BrakeChanges":
                    description = helptext = "Saves nr of times that brake signal has been changed.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.N_VapourTest1":
                    description = helptext = "If obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim and active test is 1 this variable will be increased.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.N_VapourTest2":
                    description = helptext = "If obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim and active test is 2 this variable will be increased.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.n_BigLeakErrorCnt":
                    description = helptext = "Number of tests that discovered big leak. If > 2 then report fault (BIG_LEAK) at ignition off. Will be cleard when a OK report";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ColdStart":
                    description = helptext = "If temperature is regared as cold start this flag is set. If temperature goes out of limits then it's clered. During workshop test there is an offset of +15 added to EvapDiagCal.T_HiLim.  Cold start definition : if ((obdCore.T_EngineStart > EvapDiagCal.T_LoLim) && (obdCore.T_EngineStart  < EvapDiagCal_T_HiLim) && (obdCore.T_AirInletStart > EvapDiagCal.T_LoLim) && (obdCore.T_AirInletStart < EvapDiagCal_T_HiLim) && (In.T_AirInlet < EvapDiagCal.T_LoLim))";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ColdStartExt":
                    description = helptext = "If temperature is regarded as cold start this flag is set. If fuel blend is over limit flag is cleared when timer goes out of limits.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_CCVMayBeStuck":
                    description = helptext = "If In.p_FuelTank < pEvapTestCal->MinTankPressure then there is a possibillity that CCV can be stucked.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ValveLockedByDiagnose":
                    description = helptext = "Indicates that evap is using valves for diagnose.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_NeedForSpeed":
                    description = helptext = "If a test is interruped or if test 2 is finished this flag is set. It will reset after Vehicle speed > 0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_IsRunning":
                    description = helptext = "Shows if diagnose is running.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_RequestElevatedIdle":
                    description = helptext = "Shows if Evap has requested elevated idle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ProductionTest":
                    description = helptext = "Shows status of Evap Production test. 0 = Test not done or not ready yet. 1 = Test OK. 2 = Leakage detected.";
