                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_WorkshopTest":
                    description = helptext = "Shows status of Evap Workshop test. 0 = Test not done or not ready yet. 1 = Test OK. 2 = Leakage detected. 3 = Test aborted due to vapour.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_DiagPrevRestOfDrvCycle":
                    description = helptext = "Indicates if diagnose is prevented from running for the rest of this driving cycle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_OkStatus":
                    description = helptext = "Shows CanisterCloseValveDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = CMD_PURGEDIAG_LOW has reported ok Bit 1 = CMD_PURGEDIAG_HIGH has reported ok Bit 2 = CMD_PURGEDIAG_MALFUNCTION has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_FaultCode":
                    description = helptext = "Shows CanisterCloseValveDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.t_Error":
                    description = helptext = "Time with pressure between min pressure limit and ok limit.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.p_RefLim":
