                case "obdCCV.ST_PurgeClosedByDiagnose":
                    description = helptext = "The Purge valve is closed by this diagnose during the rationality test.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_ActiveRationality":
                    description = helptext = "CCV diagnose is running the rationality test. During this test the diagnose somtimes take control over the purge valve. This flag is read by the evap diagnose as a precondition since the evap diagnose also wants to take control over the purge valve.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_OkStatus":
                    description = helptext = "Shows PurgeValveDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = EVAP_SYSTEM_PURGE_CONTROL_VALVE_CIRCUIT_OPEN has reported ok Bit 1 = EVAP_SYSTEM_PURGE_CONTROL_VALVE_CIRCUIT_SHORTED has reported ok Bit 2 = EVAP_SYSTEM_INCORRECT_PURGE_FLOW has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_FaultCode":
                    description = helptext = "Shows PurgeValveDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.Ramp0":
                    description = helptext = "Ramp 0 result. How much vapour is it";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.BreakPreCondition":
                    description = helptext = "1 = In.v_Vehicle > 0 2 = obdPurge.ST_NeedForSpeed > 0 3 = obdPurge.ST_DiagDone = 1 4 = obdCore.T_AirInletStart < EvapDiagCal.T_LoLim 5 = obdCore.T_AirInletStart > EvapDiagCal.T_HiLim 6 = obdCore.T_EngineStart < EvapDiagCal.T_LoLim 7 = obdCore.T_EngineStart > EvapDiagCal.T_HiLim 8 = Purge.p_DiffNormal > -150 9 = Purge.Status is not 0 (Off) or 6 (Controlled by diagnose) 10 = obdCCV.ST_FaultCode > 0 11 = obdTEng.ST_FaultCode > 0 12 = obdABS.ST_FaultCode > 0 13 = obdCore.ST_FirstDCYAfterPowerUp = 0 14 = obdpTank.ST_FaultCode > 0";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_ActiveDiag":
                    description = helptext = "Purge diagnose rationality state 0 = Not active 1 = Active 2 = Fault determined, but waiting to report";
