                case "LimpIn.M_TCTrqRqVal":
                    description = helptext = "Traction Control Torque Request Value This signal is the requested torque at the engine output. - It can be smaller than Engine Torque Actual e.g. when wheels are spinning or during gearshifts. - It can be greater than Engine Actual Torque e.g. for drag torque control. Intervention type (reduction/increase) has to be commanded by Traction Control Torque Intervention Type. Traction Control Torque Request Validity shall be set to 'Invalid' if the primary inputs for determining the data value have failed or are unavailable and a backup value cannot be determined.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.Cnt_TCTrqRqProt":
                    description = helptext = "Traction Control Torque Request Protection The signal is a protection value for Traction Control torque  requests. The protection value has to be calculated in Powertrain as the 2's complement of (Traction Control Torque Request + Traction Control Alive Rolling Count) of each request, independent of an active or no active torque request. Protection value for torque safety reasons. The protection value has to be calculated as 2's complement of (16 bit torque request + transmitted alive rolling counter value) in each message. The 16-bit torque request consists of 2 bits intervention type (most significant bits), 2 bits realization suggestion and the 12-bit torque value (lowest significant bits). The required sum of the transmitted rolling counter value and the 16-bit torque request shall be performed via binary addition. The addition result shall be limited to 16 bits (cut), i.e. evaluation of a possible overflow is prohibited. This counts also (16-bit cut, no overflow evaluation) for 2s complement processing. Example:	 Intervention type = $2, realization suggestion = $2, torque request value = $3DF, rolling counter = $3. Addition   = 1010 0011 1101 1111 + 11 = 1010 0011 1110 0010 = $A3E2 Protection = 0101 1100 0001 1101 +  1 = 0101 1100 0001 1110 = $5C1E Any request with a wrong protection value will be ignored by ECM. Ten wrong protection values in driving cycle will lead to an irreversible rejection of all further torque requests by ECM until the end of the respective driving cycle. Any  request with a wrong protection value will not be executed by Powertrain. A  t.b.d. number (normally ten) of wrong protection values in one driving cycle will lead to an irreversible rejection of all further torque requests by Powertrain until the end of the respective driving cycle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.M_TrnTrqRqVal":
                    description = helptext = "Torque Request Value. It is used to provide the TCM with means to control the engine torque during gear shift. This signal is the requested torque at the engine output. It can be smaller than Engine Torque Actual e.g. when wheels are spinning or during gearshifts. It can be greater than Engine Actual Torque e.g. for drag torque control. Intervention type (reduction/increase) has to be commanded by Torque Intervention Type. Torque Request Value shall be ignored if Torque Intervention Type = No Intervention. The engine controller shall limit torque increase by value and/or time to insure that no undesired vehicle acceleration occurs.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
