                case "LimpIn.ST_CrsCntCncRq":
                    description = helptext = "Cruise Control Cancel Request is transmitted by the CIM. The signal could be sent with a value of 1 (TRUE) to inform the ECM to cancel cruise due to one of the following reasons: 1. Cruise cancel switch is pressed 2. Parking brake is set 3. A problem with the brake system is detected";
