                    break;
                case "LimpIn.Cnt_CrsCntlAliveRC":
                    description = helptext = "Cruise Control Alive Rolling Count The signal indicates that the senders processing software module is still alive. The rolling counter value shall be incremented in every transmitted message in the order 0, 1, 2, 3, 0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_CrusCntSwProt":
                    description = helptext = "Cruise Control Switch Protection Value The signal indicates that the senders processing software module still is working properly.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.Cnt_TCAliveRC":
                    description = helptext = "Traction Control Alive Rolling Count             The Rolling Counter shall be an incremented value in the following decimal order: 0, 1, 2, 3, 0,...  Three Rolling Counter update errors in a t.b.d. number (normally ten) of  consecutive frames will lead to an irreversible rejection of all further torque requests by Powertrain until the end of the respective driving cycle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TCSysAtv":
                    description = helptext = "Traction Control System Active Powertrain will cancel cruise control when the data value of this signal is 'True' for a calibratable time. 0 = False 1 = True";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TCSysEnbld":
                    description = helptext = "Traction Control System Enabled This signal is used by the traction control algorithm in the powertrain controller. Powertrain may also disable brake torque management when the traction control system has been turned off. 0 = False 1 = True";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TCTrqIntvTyp":
                    description = helptext = "Traction Control Torque Intervention Type This signal indicates the type of the requested torque intervention. A torque reduction or increase is defined with respect to the calculated engine crankshaft torque. 0 = No Intervention 1 = Reduce Torque 2 = Increase Torque";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TCTrqRdnRlzSg":
                    description = helptext = "Traction Control Torque Reduction Realization Suggestion If a smooth intervention is required or engine torque shall be limited for longer terms, e.g., to avoid transmission damages, 'Throttle Only' can be commanded to force use of throttle adjustment. If the torque intervention shall be only for short time, after which the engine shall return to the original torque as fast as possible, 'No Throttle Usage' can be commanded via the Traction Control Torque Intervention Type signal and the Powertrain electronics shall try to use only ignition retard or fuel cut-off. 0 = No suggestion 1 = No throttle usage 2 = Throttle only (no ignition usage)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.X_TrnActGr":
                    description = helptext = "Transmission Actual Gear. It is the engaged gear that Powertrain determines from the best available inputs such as - engine speed/vehicle speed ratio, - turbine speed/output speed ratio, - commanded gear, - Drive/Reverse pressure discretes, - PSM Transmission Gear Selector Position, - PRNDL Transmission Gear Selector position, - P/N switch discrete, - clutch discrete, depending upon application. The forward gear states are determined based on comparing the gear ratio across the input and output speed sensors to a calibrated range of ratios corresponding to each available forward gear. The Reverse and Neutral states are assigned just as the Transmission Gear Selector Position signal. Note:  Forward drive gear states are not updated to the currently engaged gear until Powertrain has determined that a gear shift is complete and stabilized. However, transmission 'engaged' state indications (Reverse and Neutral) are updated based upon detection of the Transmission Gear Selector Position. 0 = Shift in Process 1 = First Gear 2 = Second Gear 3 = Third Gear 4 = Fourth Gear 5 = Fifth Gear 6 = Sixth Gear 7 = Seventh Gear 8 = Reverse 9 = Neutral";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.X_TrnGrSlctrPos":
                    description = helptext = "Transmission Gear Selector Position. It represents the driver-selected gear position. Powertrain commands the state of PRNDL based on the unfiltered value of the four Mode Indication switch inputs to the Powertrain electronics (PRNDL A, PRNDL B, PRNDL C, and PRNDL P) on electronically-controlled automatic transmissions. The Mode Indication switch inputs are read and processed every 12.5 ms. If the Mode Indication switch is failed, the transmission pressure switch (PSM) is used if available to determine PRNDL when in D1, D2, D3, D4, or R when the engine is running. The PSM is read and processed every 25 ms. The PSM information is invalid when the engine is not running or in Park or Neutral. Therefore, the validity bit shall be set to 'Invalid' when a valid PRNDL state cannot be determined due to a failure that does not allow a valid state to be determined or if the PRNDL position is actually between valid positions. Transmission Gear Selector Position Validity shall be set to 'Invalid' if the sensor providing the data has failed and a backup value cannot be determined. Transmission Gear Selector Position is typically used for display purposes however it may be monitored by other Platform devices for miscellaneous body functions. The Brake Apply Sensing System uses it in its algorithm for determining brake lamp operation in the event of a brake apply sensor failure. 0 = Shift In Progress 1 = First Gear 2 = Second Gear 3 = Third Gear 4 = Fourth Gear 5 = Fifth Gear 6 = Sixth Gear 7 = Seventh Gear 8 = Reverse 9 = Neutral A = Park B = Drive C = Overdrive D = Intermediate E = Low F = Manual";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnGrShftDir":
                    description = helptext = "Transmission Gear Shift Direction The shift in progress states are used to communicate that a shift is occurring for automatic transmissions. The signal is set to the appropriate state when the respective shift solenoid state changes. The signal remains set throughout the shift delay, the ratio change and the end timing of the shift. The 'No Shift in Progress' signal state is assigned when no shifts are occurring (i.e. the transmission is in the steady state operating mode). 0 = No Shift in Progress 1 = Upshift in Progress 2 = Downshift in Progress";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnTrqIntvTyp":
                    description = helptext = "Transmission Torque Intervention Type. It is used to provide the TCM with means to control the engine torque during gear shift. This signal indicates the type of the requested torque intervention. The default value is No Intervention, in which case Torque Request Value shall be ignored. 0 = No Intervention 1 = Reduce Torque 2 = Increase Torque";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnTrqRdnRlzSg":
                    description = helptext = "Torque Reduction Realization Suggestion. It is used to provide the TCM with means to control the engine torque during gear shift. With this signal a certain type of torque realization can be requested. The default value is No Suggestion, in which case it is the ECMs responsibility to choose the proper means for the torque adjustment. If the torque intervention shall be only for short time after which the engine shall return to the original torque as fast as possible, No Throttle Usage can be commanded and the ECM shall try to use only ignition retard or fuel cut-off. If a smooth intervention is required or engine torque shall be limited for longer terms e.g. to avoid transmission damages, Throttle Only can be commanded to force use of throttle adjustment. 0 = No Suggestion 1 = No Throttle Usage 2 = Throttle Only";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnTrqCnvCltSt":
                    description = helptext = "Transmission Torque Converter Clutch Status. The Transmission is equipped with a Torque Converter Clutch which is engaged at certain speed and gears to decrease the fuel consumption. The signal shows the status of the Torque Converter Clutch in the Transmission and is used for the engine anti-jerk function in the ECM. 0 = Disengaged (Open converter) 1 = Engaging   (Sliping lockup) 2 = Engaged    (Locked converter)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnEmsMlfAtv":
                    description = helptext = "Transmission Emissions Related Malfunction Active. The data value is set to 'True' when the TCM has detected and stored an emission related DTC (Diagnostic Trouble Code). Transmission Emissions Related Malfunction Active is received by the Engine Control Module. It is used to control the MIL (Malfunction Indicator Lamp) for display purposes.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnNtrlCntMdAtv":
                    description = helptext = "Transmission Neutral Control Mode Active. The transmission is equipped with a special function that makes it possible to activate neutral mode when - Drive position is selected, - vehicle speed is zero and - the brakes are applied. This function decrease the fuel consumption. The signal is used to keep a stable idle speed when the Transmission engage/disengage the clutches.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnWrmUpShftPtrn":
                    description = helptext = "TCM warmup shift pattern command active. 0 = normal shift pattern, 1 = warmup shift pattern";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_ThrtlPrgrsnReq":
                    description = helptext = "Throttle Progression Request 0=Map A 1=Map B 2=Map C";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnWntrShPtSt":
                    description = helptext = "Transmission Winter Shift Pattern Status";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnFrzFrStrRq":
                    description = helptext = "Transmission Powertrain Freeze Frame Data Request Since not all data from the Engine is available on the CAN bus during normal communication, some data has to be sent from the ECM when the TCM detects and store its first OBDII DTC (Diagnostic Trouble Code).The freeze frame data is stored together with the DTC in the TCM. The data value is set to 'Take Freeze Frame' when the TCM wants the ECM to transmit the relevant freeze frame data. When the data value equals 'Take Freeze Frame', the ECM will take the action to collect and send the OBD-II freeze frame data to the TCM.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.ST_TrnEmRelDTC_Str":
                    description = helptext = "Transmission Emissions Related DTC: Stored The trouble code shall be transferred in the KW-2000 format without failure symptom. Only if the freeze frame request bit is set, a DTC shall be sent, otherwise value 00 hex. Always after ignition on, i.e. at the beginning of a driving cycle the value 00 has to be transmitted. If a DTC is sent by TCM (value  0), the DTC value shall remain constant for at least one second. The transmitted trouble code will not be stored in the ECM failure memory, but in the respective ECM Freeze Frame. 0 = False 1 = True";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "LimpIn.TrnEmRelDTC_SysDes":
                    description = helptext = "Transmission Emissions Related DTC:System Designator 0 = P0-Powertrain Codes SAE Controlled 1 = P1-Powertrain Codes MFG Controlled 2 = P2-Powertrain Codes Reserved 3 = P3-Powertrain Codes Reserved 4 = C0-Chassis Codes SAE Controlled 5 = C1-Chassis Codes MFG Controlled 6 = C2-Chassis Codes Reserved 7 = C3-Chassis Codes Reserved 8 = B0-Body Codes SAE Controlled 9 = B1-Body Codes MFG Controlled A = B2-Body Codes Reserved B = B3-Body Codes Reserved C = U0-Network Codes SAE Controlled D = U1-Network Codes MFG Controlled E = U2- Network Codes Reserved F = U3-Network Codes Reserved";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
