                    description = helptext = "Engine Torque Actual Powertrain Interface Definition: Engine Torque Actual is transmitted by Powertrain. It is the calculated torque at the engine output (crankshaft) considering internal friction of the engine and all external connected systems such as generator or the air conditioning system. Platform Interface Definition: Engine Torque Actual is received by Platform. This signal is used as an input to the traction control system in order to calculate the required torque for traction control.";
