                    description = helptext = "Engine Torque Driver Requested Powertrain Interface Definition: Engine Torque Driver Requested is transmitted by Powertrain. This signal is the unfiltered calculated driver demanded torque commanded via accelerator position or by cruise control. This torque represents the engine torque level that would be present if torque management were not active. Platform Interface Definition: Engine Torque Driver Requested  is received by Platform. This signal is used as an input to the traction control system in order to calculate the required torque for traction control.";
