                    break;
                case "ECUIDCal.ECMBasicComplete_PartNo":
                    description = helptext = "This is the complete part no for the ECM after the application download at Saab engine production. It includes following two part numbers: - ApplicationSoftware_PartNo - ECMHardwareComplete_PartNo The number is handled as a calibration data and is applied with AppTool to the application software. The application (including this number) is downloaded in Saab engine production.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ECUIDCal.ApplicationFileName":
                    description = helptext = "Complete filename of the application software file. This filename is stored in the same way as calibration data and is applied by AppTool when a new file is created. File name architecture: <SW version label>_<variant>_<programmer id>_<calibration version>_<calibrator id>_<engine variant code> Example: F60B_O_1EPA_0A_EBD_56A <SW version label> Software version label used to identify each software release from FMEP. Example 'F60B' First letter 'F' can be: F - T8 / L850T G - T9 / SVC H - T9 / SCC Letter 2 '6' indicates major variant or model year, like Proto1, Proto2, My03... Letter 3-4 is updated every new release, like the following: 01,02...09,0A...0Z, 10,11...1Z,20,21... <variant> Indicates if the file is Open or Closed. In open files is all calibration data stored in RAM and can be changed in runtime with AppTool. Closed files have all calibration data in ROM and can only be changed offline with specific access level in AppTool. O - Open C - Closed  <programmer id> The programmer ID will on official releases always be 'FMEP'. On test software will it be used to identify the programmer who created the software plus a number for different versions of testcode. Example 'F60B_O_1EPA' will in this case mean that Torkel Wahlberg (FMEPA) have made an open test program based on the version F60B. In case of consultants shall a number be used instead of the last character, example '1EP2' shall be used by the second consultant at FMEP (FMEP-K2). <calibration version> This two characters is used for the calibration engineers version control, in the same way as part of the SW version label. 01,02...09,0A...0Z, 10,11...1Z,20,21... <calibrator id> This ID is used to identify the calibration engineer who have implemented the calibration data in the file. Used in the same way as programmer id but without the number. Example: 'EBD' is Peder Nordenback (FMEBD). On official releases will this ID be set to 'FME'. <engine variant code> Used to identify the calibration variant. Every complete file that is released from FME will have a unique engine variant code. All official variant codes are stored in the CR database. Example: '56B', '47A' etc. ']";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
