                    description = helptext = "Each time that engine has started this counter will be increased.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDCoreAdap.MIL_Distance":
                    description = helptext = "Accumulated distance in km that MIL has been lit. EC2000 regulation. Max distance 65536 km.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDCoreAdap.l_DistSinceFaultsCleared":
                    description = helptext = "Distance accumulated since DTCs were cleared (via an external test equipment or possibly, a battery disconnect). This PID is not associated with any particular DTC. It is simply an indication for I/M (Inspection/Maintenance), of the last time an external test equipment was used to clear DTCs. If greater than 65,535 km have occurred, CLR_DIST shall remain at 65,535 km and not wrap to zero.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDCoreAdap.N_WarmUpCyclesSinceFaultsCleared":
                    description = helptext = "Number of OBD warm-up cycles since all DTCs were cleared (via an external test equipment or possibly, a battery disconnect) A warm-up is defined in the OBD regulations to be sufficient vehicle operation such that coolant temperature rises by at least 22 oC (40 oF) from engine starting and reaches a minimum temperature of 70 oC (160 oF) (60 oC (140 oF) for diesels). This PID is not associated with any particular DTC. It is simply an indication for I/M, of the last time an external test equipment was used to clear DTCs. If greater than 255 warm ups have occurred, WARM_UPS shall remain at 255 and not wrap to zero.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDCoreAdap.injector_tested":
                    description = helptext = "Is used to prevent that an injector is flow tested more than once without running the engine in between. Also used to prevent that a sparc is fired in any cylinder if any injector has been flow tested without running the engine in between. Bit0:Cyl1 - Bit5:cyl6 Used for Device control";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDCoreAdap.ST_EngFlrCdeRtrR":
                    description = helptext = "Engine Failure Code Retrieval Required. (Opel requirement)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.LeakageResult":
                    description = helptext = "Saves the obdEvap.LeakageResult for scantool evalutation, If there is a big leak the obdEvap.LeakageFactor is saved instead.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.EvapStack":
                    description = helptext = "When Evap test 1,3,4 has succeded will put it's evaluation value into this stack.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.StackResult":
                    description = helptext = "Average value from OBDAdapEvap.EvapStack";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.n_Evap2BigResDiff":
                    description = helptext = "This counter will increase if the leakageresult i evap diagnose is a bigger diff than 2 compared to the last result in EvapStack and the result will not be inserted to the stack. Next time a diagnose has performed the result will automaticly be inserted due to this counter > 0. It will be set to 0 when a value is inserted into the stack.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.N_OutOfLimTemp":
                    description = helptext = "Every time that precondition has been fullfiled except the temperature limit, this counter will be increased. When counter >= 3 the diagnose will report readiness. It's cleared when diagnose reports either fault or ok;";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "OBDAdapEvap.N_DiagPerformed":
                    description = helptext = "Number of performed evaporator tests. Used by the frequency counter logic to evaluate ST_AllPreCondForFaultDetectOk.";
