                    description = helptext = "Blend diff when Boff measurements is active compared to when it started.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoffProt.X_blendOld":
                    description = helptext = "Old blend value for calculating blend diff.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoffProt.ST_subState":
                    description = helptext = "State machine for flexfuel boiloff from crankcase (Boff) 0x0000 - RESET state ECU reset or ECU reprogramming 0x0100 - IDLE state (this state is always entered after engine start) ...0x0101 - Sampling crank fuel during engine start ...0x0102 - coldstart>0, jumping to DETECT state ...0x0103 - accfuel>0 ...0x0104 - coldstart=0 and accfuel<=0 0x0200 - DETECT state ...0x0201 - Engine coolant temp too low ...0x0202 - Too high airflow too trigg Boff ...0x0203 - Lambda integrator has not trigged boff measurement 0x0300 - MEASUREMENT state, boff is regulating boff fuel ...0x0301 - Freeze constrateInt timer fuelcut ...0x0302 - Freeze constRateInt timer pga. constRate map value is 0 ...0x0303 - Freeze constrateInt timer pga. Q_AirInlet to high ...0x0304 - Freeze constrateInt timer injection time zero ...0x0305 - Freeze constRateInt pga. lambda integrator inside limits ...0x0306 - Freeze constrateInt fueladap active ...0x0307 - Freeze constrateInt engine coolant temp too low ...0x030F - constRateInt regulating normally 0x0600 - RAMPING state, boff fuel is ramped away 0xFF00 - DISABLED state Boff function is disabled ...0xFF01 - Flexfuel enable flag false ...0xFF02 - Boff enable flag false 0xFFFF - Serious error, user should contact someone";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoffProt.ST_crankSampling":
                    description = helptext = "Flag set when sampling of injected fuel is done before ECMStat.STEngineStarted is set.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoffProt.ST_trigged":
                    description = helptext = "Boff constrateInt has been high enough to confirm that Boff is present.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoffProt.X_constRateEngOff":
                    description = helptext = "The constant rate integrator adaptation factor when engine is started.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoff.X_constRateInt":
                    description = helptext = "Integrator that gains the constRate flow from crankcase. This value contains the flexfuel level from crankcase.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoff.ST_active":
                    description = helptext = "Indicates that Boff measurement is active.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "FFBoff.ST_fuelAdap":
