                case "CoreDiagCal.U_LowLim":
                    description = helptext = "If diagnose function is setup to check battery range, the core will check if In.U_Battery < CoreDiagCal.U_LowLim or > CoreDiagCal.U_HighLim. If battery signal is out of range the D.F will shut off, be resetedn and not started before battery signal is within limits again.";
