                case "CoreDiagCal.ST_ManufactorCode":
                    description = helptext = "There might be differences in the diagnostic system between car manufactorer This will tell which manufactorers faultcodes that is used. 1 = SAAB 2 = Opel";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
