                    break;
                case "CoreDiagCal.p_PosAmbDiffLim":
                    description = helptext = "Maximum difference between the estimated ambient pressure, AirAmbient.p_AirAmbient, and AirAmbient.p_AirAmbientMax. Depending on the value of AirAmbient.p_AirAmbient, one out of these three limits are used. If BAP > CoreDiagCal.p_AmbDiffLimSP[0] => CoreDiagCal.p_PosAmbDiffLim[0] is used. If BAP < CoreDiagCal.p_AmbDiffLimSP[1] CoreDiagCal.p_PosAmbDiffLim[2] is and otherwise CoreDiagCal.p_PosAmbDiffLim[1].";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoreDiagCal.p_NegAmbDiffLim":
                    description = helptext = "Maximum difference between the estimated ambient pressure, AirAmbient.p_AirAmbient, and AirAmbient.p_AirAmbientMin. Depending on the value of AirAmbient.p_AirAmbient, one out of these three limits are used. If BAP > CoreDiagCal.p_AmbDiffLimSP[0] => CoreDiagCal.p_NegAmbDiffLim[0] is used. If BAP < CoreDiagCal.p_AmbDiffLimSP[1] CoreDiagCal.p_NegAmbDiffLim[2] is and otherwise CoreDiagCal.p_NegAmbDiffLim[1].";
                    category = XDFCategories.Undocumented;
