                    description = helptext = "Supportpoints to select CoreDiagCal.p_MaxAmbDiffLim[3] and CoreDiagCal.p_MinAmbDiffLim[3]";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoreDiagCal.ST_ActiveDiagSystem":
                    description = helptext = "If DID 01 indicates that the type of diagnostic system is 'undefined', this variable is used to decide which diagnose system that should be active. 0 - OBD2 1 - EOBD 2 - LOBD";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoreDiagCal.ST_ACType":
                    description = helptext = "Air condition type 0 - Not defined 1 - (SAAB): Manual ECC -> AC-request guarded by BdyVDA. (Opel): Manuel ECC or ECC with clutch -> AC-request guarded by BdyVDA 2 - (Only SAAB) ECC with clutch -> AC-request guarded by ClimCntlVDA 3 - ECC clutchless -> AC-request guarded by ClimCntlVDA 4 - No AC";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
