                case "CoolFanCal.K_VehicleSpdIsZeroLo":
                    description = helptext = "Hysteresis pair (K_VehicleSpdIsZeroHi and K_VehicleSpdIsZeroLo) of calibrations that define the vehicle speed below which the vehicle is considered at idle. Minimum Range: 0 to 10 kph Minimum Resolution: 0.5 kph Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_Speed_ON_FanSP":
