                    description = helptext = "The percentage of fan power threshold for %Fan_Command below which fan speed n is commanded, where n = 0 to 6. Minimum Range: 0 to 100% Minimum Resolution: 0.5% Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
