                    description = helptext = "The percentage of fan power threshold for %Fan_Command below which fan speed n is commanded, where n = 0 to 6. Minimum Range: 0 to 100% Minimum Resolution: 0.5% Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_ECT_FanReqTAB":
                    description = helptext = "Calibration table that contains the percentage of fan power required for the corresponding engine coolant temperature defined by the table in section 4.2.4.8.1.1, where n = 0 to 16. Minimum Range: 0 to 100% Minimum Resolution: 0.5%";
