                    description = helptext = "Calibration table that contains the percentage of fan power required for the corresponding engine oil temperature defined by the table in section 4.2.4.8.1.3, where n = 0 to 7. Minimum Range: 0 to 100% Minimum Resolution: 0.5%";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.T_EngOilSP":
                    description = helptext = "Support points to table CoolFanCal.K_TempEngOil_FanReqTAB";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_FanAdjustLimitHi":
                    description = helptext = "If Fan_Required is higher than this NO adjustment is made for a platform request. If Fan_Required is between K_FanAdjustLimitHi and K_FanAdjustLimitLo the following formula is used : Fan_Required = Fan_Required + Platform_Adjust_Fan * ( 1 - ( ( Fan_Required - CoolFanCal.K_FanAdjustLimitLo ) / ( CoolFanCal.K_FanAdjustLimitHi - CoolFanCal.K_FanAdjustLimitLo ) ) ).  Calibration value that defines the percentage of fan power threshold such that when Vehicle_%Fan_Required is above it, no Platform-Requested adjustment of fan speed is allowed. Minimum Range: 0 to 100% Minimum Resolution: 0.5% Typical Values:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_FanAdjustLimitLo":
                    description = helptext = "If Fan_Required is less than or equal than this, Fan_Required is adjusted as : Fan_Required = Fan_Required + Platform_Adjust_Fan. Calibration value that defines the percentage of fan power threshold such that when Vehicle_%Fan_Required is below it, the full amount of Platform-Requested adjustment of fan speed is used. Minimum Range: 0 to 100% Minimum Resolution: 0.5%";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_VehicleSpdFanAdjustHi":
                    description = helptext = "If vehicle speed is less than K_VehicleSpdFanAdjustHi and K_VehicleSpdFanAdjustLo acting as a hysteresis pair, no vehicle speed adjustment is made on Fan_Required. Hysteresis pair (K_VehicleSpdFanAdjustHi and K_VehicleSpdFanAdjustLo) of calibrations that define the vehicle speed below which, no fan speed adjustment due to vehicle speed is allowed. The value of these calibrations must be less than K_MaxVehicleSpeed. Minimum Range: 0 to 300 kph Minimum Resolution: 1 kph Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_VehicleSpdFanAdjustLo":
                    description = helptext = "If vehicle speed is less than K_VehicleSpdFanAdjustHi and K_VehicleSpdFanAdjustLo acting as a hysteresis pair, no vehicle speed adjustment is made on Fan_Required. Hysteresis pair (K_VehicleSpdFanAdjustHi and K_VehicleSpdFanAdjustLo) of calibrations that define the vehicle speed below which, no fan speed adjustment due to vehicle speed is allowed. The value of these calibrations must be less than K_MaxVehicleSpeed. Minimum Range: 0 to 300 kph Minimum Resolution: 1 kph Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_CoolantTempOverride":
                    description = helptext = "If T_Engine is greater than K_CoolantTempOverride no vehicle speed adjustment is made on Fan_Required.  Calibration value that defines an Engine_Coolant_Temperature threshold used for both of the following: 1) the temperature below which the scan tool is allowed to override the fan speed via device control; and 2) the temperature below which adjustments to Vehicle_%Fan_Required due to vehicle speed are allowed. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_TempTransOilHi":
                    description = helptext = "If T_Transmission is greater than K_TempTransOilHi no vehicle speed adjustment is made on Fan_Required. Hysteresis pair (K_TempTransOilHi and K_TempTransOilLo) of calibrations that define the Transmission_Oil_Temperature above which T_Oil_%Fan_Required is set equal to 100%. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_TempTransOilLo":
                    description = helptext = "Hysteresis pair (K_TempTransOilHi and K_TempTransOilLo) of calibrations that define the Transmission_Oil_Temperature above which T_Oil_%Fan_Required is set equal to 100%. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_TempEngOilHi":
                    description = helptext = "Fan_Required for high engine oil temperature is 100% if: OilTemp.T_Oil greater than K_TempEngOilHi and K_TempEngOilHi acting as a hysteresis pair. Otherwise Fan_Required is 0 for this request. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AC_PressureHigh":
                    description = helptext = "If In.p_AC is greater than K_AC_PressureHigh no vehicle speed adjustment is made on Fan_Required.  Calibration that defines the AC_High-side_Pressure above which adjustments to Vehicle_%Fan_Required due to vehicle speed or adjustments to %Fan_Command due to wide open throttle are not allowed.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_MaxVehicleSpeed":
                    description = helptext = "Fan_Required is adjusted for vehicle speed as : Fan_Required = Fan_Required * (1-(In.v_Vehicle/K_MaxVehicleSpeed)). The maximum speed the vehicle is capable of. Minimum Range: 0 to 300 kph Minimum Resolution: 1 kph Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AfterRunFan":
                    description = helptext = "Fan_Command when after run of cooling fans. The percentage of fan power required for After-Run cooling fan operation.  On discrete fan systems, this value should be calibrated such that it results in only cooling fan output driver #1 active.  On PWM fan systems, this value can be calibrated to any value within the defined range. Minimum Range: 0 to 100 % Minimum Resolution: 0.5 % Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
