                    description = helptext = "Support point for K_AfterRunTimeTAB The time limit during After-Run operation to compare Engine_Coolant_Temperature to K_AfterRunContinueTemp[n] in order to determine if After-Run should be terminated, where n = 0 to 4. Minimum Range: 0 to 15 minutes Minimum Resolution: 0.5 minutes Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AfterRunTimeTAB":
                    description = helptext = "Time for after run of cooling fans. The time limit during After-Run operation to compare Engine_Coolant_Temperature to K_AfterRunContinueTemp[n] in order to determine if After-Run should be terminated, where n = 0 to 4. Minimum Range: 0 to 15 minutes Minimum Resolution: 0.5 minutes Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AfterRunStartTempHi":
                    description = helptext = "Hysteresis pair (K_AfterRunStartTempHi and K_AfterRunStartTempLo) of calibrations that define the Engine_Coolant_Temperature above which After-Run operation is started, and the %Fan_Command is set equal to K_AfterRun%Fan. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AfterRunStartTempLo":
                    description = helptext = "Hysteresis pair (K_AfterRunStartTempHi and K_AfterRunStartTempLo) of calibrations that define the Engine_Coolant_Temperature above which After-Run operation is started, and the %Fan_Command is set equal to K_AfterRun%Fan. Minimum Range: -40 to +140 degreesC Minimum Resolution: 1 degreesC Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_AfterRunTimeMax":
                    description = helptext = "The maximum amount of time After-Run operation can continue. Minimum Range: 0 to 15 minutes Minimum Resolution: 0.5 minutes Typical Value:";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_FanPwrUpDelay":
                    description = helptext = "The time that defines the amount of time to delay while the engine is running before engaging the coolant fan. Minimum Range: 0 to 3276.7 seconds Minimum Resolution: 0.1 second Typical Value: 3.0 seconds";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_D1_SpeedTAB":
                    description = helptext = "Calibration values that define the state of output driver #1 which corresponds with fan speed 1 through fan speed 6. Minimum Range: ON or OFF";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "CoolFanCal.K_D2_SpeedTAB":
                    description = helptext = "Calibration values that define the state of output driver #2 which corresponds with fan speed 1 through fan speed 6. Minimum Range: ON or OFF";
                    category = XDFCategories.Undocumented;
