                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.n_RampKeep":
                    description = helptext = "During the keep phase (idle rpm is kept on syncronous rpm) the idle rpm will be reduced with this rpm value everery 25ms. This ramp shall be used to slowly ramp down the rpm during keep phase to avoid overshoot when rpm is landing on syncronous rpm and also to make the engine speed continiously drop on the drivers rpm instrumentation.";
