                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.n_AimOffset":
                    description = helptext = "When a gearshift is detected and all conditions are fullfiled to start the gearshift support will the syncronous rpm on next gear be calculated and this offset will be added on that calculated rpm. The reason for this is to aim little above next syncronous rpm and make it possible to reduce the rpm slowly during the keep phase. ManGrShftProt.n_NextGear = This value + calculated rpm for next gear";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.GrShftRatioHigh":
                    description = helptext = "When the acc pedal is released below 10% is this factor once multiplied with the filtered gear ratio, to make a high limit for detection of a change in gear ratio. If the filtered ratio is abowe that limit will the ManGrShft.ST_GearShifting be set. ManGrShftProt.RatioHigh = ManGrShftProt.RatioFilt * ManGrShftCal.GrShftRatioHigh";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.GrShftRatioLow":
                    description = helptext = "When the acc pedal is released below 10% is this factor once multiplied with the filtered gear ratio, to make a low limit for detection of a change in gear ratio. If the filtered ratio is below that limit will the ManGrShft.ST_GearShifting be set. ManGrShftProt.RatioHigh = ManGrShftProt.RatioFilt * ManGrShftCal.GrShftRatioHigh";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.FiltFac":
                    description = helptext = "Filter factor used for the gear ratio. Formula: 100 * ( new_value - old_value ) +/- Const Filt_value = old_value + ------------------------------------------- Const if old_value > new_value -> - Const, if old_value <= new_value -> + Const Filt_value  -> ManGrShftProt.RatioFilt old_value   -> old ManGrShftProt.RatioFilt new_value   -> ManGrShftProt.Ratio Const       -> ManGrShftCal.FiltFac If Const = 1 to 8, effective filter is used (shift. instead of division). (100 & 0 = 100% new, 200 & 1 = 50% new, 400 & 2 = 25% new 800 & 3 = 12.5% new, 1600 & 4 = 6.25% new etc.)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "ManGrShftCal.ClutchMode":
                    description = helptext = "Mode selection on how to set the gearshifting flag, ManGrShft.ST_GearShifting. Modes: 0 - Use only the In.ST_ClutchBrake1 1 - Use both the In.ST_ClutchBrake1 and if the clutch is pressed for more than 3 sec, start the gear ratio gearshift detection. 2 - Use only the gear ratio gearshift detection. Gear ratio gearshift detection: When the pedal is released below 10% is a high and low ratio limit calculated, ManGrShftProt.RatioLow and ManGrShftProt.RatioHigh, when the ratio is above the high limit or below the low limit is the ManGrShft.ST_GearShifting flag set. When the pedal is above 5% and a gear is detected and the ManGrShftProt.RatioDelta is below 5 will the ManGrShft.ST_GearShifting flag be cleared.";
